import React, { useState, useEffect } from "react";
import handImage from "./prostheticHand.png";


function Slider({ id, value, onChange }) {
  const handleChange = (event) => {
    onChange(event.target.value);
  };

  const fingerStyle = {
    position: "absolute",
    left: "50%",
    transform: "translate(-50%, -80%)",
    width: "30px",
    height: "150px",
    borderRadius: "15px",
    background: "#ccc",
    zIndex: 1
  };

  let fingerPosition;

  if (id === "1") {
    fingerPosition = {top: "80px"};
  } else if (id === "2") {
    fingerPosition = {top: "30px"};
  } else if (id === "3") {
    fingerPosition = {bottom: "20px"};
  } else if (id === "4") {
    fingerPosition = {bottom: "70px"};
  }

  return (
    <div style={{ height: "200px", display: "flex", flexDirection: "column", position: "relative" }}>
      <div style={{...fingerStyle, ...fingerPosition}}></div>
      <input
        type="range"
        min="0"
        max="180"
        value={value}
        onChange={handleChange}
        style={{ height: "100%", appearance: "slider-vertical", background: "auto", outline: "none" }}
      />
      <div style={{ alignSelf: "center", zIndex: 2 }}>{`Slider ${id}: ${value}`}</div>
    </div>
  );
}


function App() {
  const [slider1Value, setSlider1Value] = useState(180);
  const [slider2Value, setSlider2Value] = useState(180);
  const [slider3Value, setSlider3Value] = useState(180);
  const [slider4Value, setSlider4Value] = useState(180);

  const [pressedKeys, setPressedKeys] = useState({});

  useEffect(() => {
    const handleKeyDown = (event) => {
      setPressedKeys((prevState) => ({
        ...prevState,
        [event.key]: true,
      }));
    };
    const handleKeyUp = (event) => {
      setPressedKeys((prevState) => ({
        ...prevState,
        [event.key]: false,
      }));
    };
    document.addEventListener("keydown", handleKeyDown); //window.addEventListener(...)?
    document.addEventListener("keyup", handleKeyUp);
    return () => {
      document.removeEventListener("keydown", handleKeyDown);
      document.removeEventListener("keyup", handleKeyUp);
    };
  }, []);

  useEffect(() => {
    const incrementSlider1 = () => {
      setSlider1Value((prevValue) => Math.min(prevValue + 1, 180));
    };
    const decrementSlider1 = () => {
      setSlider1Value((prevValue) => Math.max(prevValue - 1, 0));
    };

    const incrementSlider2 = () => {
      setSlider2Value((prevValue) => Math.min(prevValue + 1, 180));
    };
    const decrementSlider2 = () => {
      setSlider2Value((prevValue) => Math.max(prevValue - 1, 0));
    };

    const incrementSlider3 = () => {
      setSlider3Value((prevValue) => Math.min(prevValue + 1, 180));
    };
    const decrementSlider3 = () => {
      setSlider3Value((prevValue) => Math.max(prevValue - 1, 0));
    };

    const incrementSlider4 = () => {
      setSlider4Value((prevValue) => Math.min(prevValue + 1, 180));
    };
    const decrementSlider4 = () => {
      setSlider4Value((prevValue) => Math.max(prevValue - 1, 0));
    };



    const intervalId = setInterval(() => {
      if (pressedKeys.q) {
        incrementSlider1();
      } if (pressedKeys.a) {
        decrementSlider1();
      }

      if (pressedKeys.w) {
        incrementSlider2();
      }  if (pressedKeys.s) {
        decrementSlider2();
      }

      if (pressedKeys.e) {
        incrementSlider3();
      }  if (pressedKeys.d) {
        decrementSlider3();
      }

      if (pressedKeys.r) {
        incrementSlider4();
      }  if (pressedKeys.f) {
        decrementSlider4();
      }
    }, 15); //this was 50 ms, I changed to 15

    return () => {
      clearInterval(intervalId);
    };
  }, [pressedKeys]);

  return (
    <div style={{ display: "flex" }}>
      <Slider id="1" value={slider1Value} onChange={setSlider1Value} />
      <Slider id="2" value={slider2Value} onChange={setSlider2Value} />
      <Slider id="3" value={slider3Value} onChange={setSlider3Value} />
      <Slider id="4" value={slider4Value} onChange={setSlider4Value} />
      <img src={handImage} alt="hand" style={{ width: "40%", height: "auto" }} />
    </div>
  );
}

export default App;
